import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import photo from 'images/download.jpg';
class Cards extends Component {


    constructor(props) {
        super(props)
        this.state = {
            agents: this.props.agents

        }
    }
    render() {
        if(this.props.Ctype==="Cdesc"&&this.props.previousField===this.props.data.coursetype){
  
            return(
              <div className="row"> 
              <div className="col s12 m6">
                <div className="card darken-1">
                  <div className="card-content black-text">
                    <span className="card-title">{this.props.data.name}</span>
                    <table
                    ><tbody>
                      <tr><th>University Name</th><td>{this.props.data.uni}</td></tr>
                      <tr><th>Fee</th><td>{this.props.data.fee}</td></tr>
                      <tr><td rowSpan="2">{this.props.data.description}</td></tr>
                    </tbody>
                    </table>
                  </div>
                </div>
              </div>
            </div> 
          );
          }
        return (

            



            <div className="row">
                <div className="col s12 m12">
                    <div className="card">
                        <div className="card-image">
                            <img src={photo}>
                            </img>
                            <h5>{this.props.data.Title}</h5>
                            <div className="card-action">
                                <Link to={{ pathname: '/CoursesContent', state: { title: this.props.Title, userId: this.props.id, agents: this.state.agents } }}>Click Me</Link>
                                <div className="card-content">
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Cards;
